import CountUI from "../../components/count"
import { connect } from 'react-redux'
import { countAction } from '../../redux/count_action'

// function mapStateToProps(state) {
//   return { data: state }
// }

// function mapDispatchToProps(dispatch) {
//   return {
//     ff: (type, value, delay) => setTimeout(() => dispatch(countAction(type, parseInt(value))), delay)
//   }
// }

// export default connect(mapStateToProps, mapDispatchToProps)(CountUI)
export default connect(
  state => ({ data: state }),

  dispatch => ({ ff: (type, value, delay) => setTimeout(() => dispatch(countAction(type, parseInt(value))), delay) })

)(CountUI)
